import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App.js';
import { 
    BrowserRouter,
    Routes,
    Route
} from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <BrowserRouter>
        <Routes>
            <Route to="/" element={<App />} />
        </Routes>
        <App />
    </BrowserRouter>
);
